import React, { Component } from 'react'; //react library
import ReactDOM from 'react-dom'; //react-dom library
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<div>
                <h1>Hello World!</h1>
                <h1>This is Second Element</h1>
                </div>,
                document.getElementById('root')) //It will render the h1 element in a container which has an id of root.

ReactDOM.render(<ul>
                <li>list order 1</li>
                <li>list order 2</li>
                </ul>, 
                document.getElementById('root'))

function MyInfo(){
  return(<h1>
    Hello World with Functional Components
  </h1>)
}

function MyApp(){
  return (
    <div>
      <h1>Hello World in functional components</h1>
    </div>
  )
}
ReactDOM.render(<MyInfo/>, document.getElementById('root'))

